import React from 'react'
import Avatar from '@mui/material/Avatar';
import boy from '../component/assets/Ezz.png';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import "./Pagesstyle.css"
import explorePic1 from "../component/assets/ExplorePics/explorePic1.avif"
import explorePic2 from "../component/assets/ExplorePics/explorePic2.avif"
import explorePic4 from "../component/assets/ExplorePics/explorePic4.avif"
import explorePic5 from "../component/assets/ExplorePics/explorePic5.avif"
import explorePic6 from "../component/assets/ExplorePics/explorePic6.avif"
import Leftbar from '../component/Leftbar';
import axios from 'axios';


export default function Profile() {
  const username = localStorage.getItem("username");
  const avatar = localStorage.getItem("avatar");
  const token = localStorage.getItem("token");


  const handleEdit= () => {
    const newDiscraption = prompt("please add the new disc");

    axios
      .request({
        method: "put",
        url: `http://16.170.173.197/users/login`,
        data: {
          user:{ 
                     userName: newDiscraption,
        }
        },
        headers: {
          Authorization: `Bearer ${token}`,
        },
      })
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.error("Error edit post:", error);
      });
  };


    const [value, setValue] = React.useState('1');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };
    const itemData = [
        {
          img: explorePic1,
          title: 'random img',
        },
        {
          img: explorePic2,
          title: 'random img',
        },

        {
          img: explorePic4,
          title: 'random img',
        },{
        img: explorePic5,
        title: 'random img',
      }
      ,{
        img: explorePic6,
        title: 'random img',
      }]
    return (
    <div id="profile">
        <Leftbar></Leftbar>
        <div id="top">

        <Avatar id="img" sx={{width:160,height:160}} src={avatar}/>

        <h2 id="name">{username}</h2>
        <Button id="butt" variant="contained" onClick={()=>{handleEdit()}}>Edit Profile</Button>
            <Button id="butt" variant="contained">View actions</Button>
            <img src={SettingsOutlinedIcon} alt="" />

            <div id="stats">
            <p id="p">5 Posts</p>
            <p id="p">211 follower</p>
            <p id="p">300 Following</p>
            </div>
            <div id="bio">
            <p id="p">ezzalden kalash</p>
            <p id="p">CSE | AAUP</p>
            </div>

            </div>
            <div className='profile_posts'>
            <Box sx={{ width: '100%'}}>
            <TabContext value={value}>

            <TabList onChange={handleChange} >
        <Tab value="1" label="Posts" sx={{ color: 'white',paddingRight:10,paddingLeft:10}}/>
        <Tab value="2" label="reels" sx={{ color: 'white',paddingRight:10,paddingLeft:10}} />
        <Tab value="3" label="Tagged" sx={{ color: 'white',paddingRight:10,paddingLeft:10}} />
      </TabList>
      <TabPanel value="1">
        <ImageList  sx={{  width: 750, height: 380,marginLeft:-10 }} cols={3} rowHeight={300}>
      {itemData.map((item) => (
        <ImageListItem key={item.img}sx={{ marginLeft:2 ,marginBottom:3}}>
          <img
            srcSet={item.img}
            src={item.img}
            alt={item.title}
          />
        </ImageListItem>
      ))}
    </ImageList></TabPanel>
    <TabPanel value="2"><div className='prog'>
    <br />
    <p >There no reels</p>    
    </div></TabPanel>
    <TabPanel value="3"><div className='prog'>
    <br />
    <p >There no tagged posts</p>    
    </div></TabPanel>
      </TabContext>

    </Box></div>





        </div>
  )
}
